export const getMentors = (theme) => {
    switch (theme) {
        case 'premium':
            return [
                'Eric Schmidt',
                'Mark Zuckerberg',
                'arry Page',
                'Elon Musk',
                'Bill Gates',
            ]
        default:
            return []
    }
}
